import React from 'react';

const style = `
.header {
  height: 75vh;
  width: 100%;
  background: url(https://media.giphy.com/media/ZcdJJvDqTgdGZK8Xd3/giphy.gif) repeat center;
  background-size: cover;
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
}

.name {
  color: white;
  font-size: 60px;
}
`;

const Header = () => {
  return (
    <div className="header">
      <style>{style}</style>
      <h1 className="name">Mark Vincent Go</h1>
      <h3>Full-Stack Software Engineer</h3>
    </div>
  );
};

export default Header;
